import PopupWithForm from "./PopupWithForm";

function ConfirmPopup ({onSubmit, onCloseButton, isOpen}) {

    const Valid = true;

    return (
        <PopupWithForm
        addConfirmClassForWindow="popup__window_type_confirmation"
        addConfirmClassForTitle="popup__title_type_confirmation"
        onSubmit={onSubmit}
        onCloseButton={onCloseButton} 
        isOpen={isOpen}
        name="delete-photo" 
        title="Подтверждаете удаление?"
        buttonText="Удалить"
        isInputValid={Valid}>
        </PopupWithForm>
    )
}

export default ConfirmPopup;
